import VueRouter from "vue-router";

import Login from "../pages/Login.vue"
import Home from "../pages/Home.vue"
import HoAllStaffViewme from "../pages/AllStaffView.vue"

export default new VueRouter({
    routes:[
        {
            name:'Login',
            path:'/',
            component: Login,
        },
        {
            name:'Home',
            path:'/home',
            component: Home,
            children:[
                {
                    name: 'AllStaffView',
                    path:'/AllStaffView',
                    component: HoAllStaffViewme,
                    props($route) {
                        return {
                            id: $route.query.staffList,
                        }
                    }
                }
            ]
        }
    ]
})
